import React from 'react'
export default function App() {
const prson=[
    {nom:'ahmed',
    age:26
    },
    {
        nom:"hamid",
        age:30
    },
    {
        nom:"doha",
        age:16
    }
]
  return (
    <div>
        {
          prson.split(' ').filter(e=>{
            return e.age<=3
          }).join(' ')
        }
      </div>
  )
}
